import React from 'react'
import { Row, Col } from 'react-grid-system';
import './scss/App.scss'

class Temp extends React.Component{
    render(){
        return(
            <Row className="temp">
                <Col xs={18}>
                    <img src={require("./images/dcoload.gif")} className="tempImg"/>
                </Col>
            </Row>
        );
    }
}

export default Temp;
